    XW += x[32]*75.088040; /*IXC3H7O2 */
    XW += x[33]*75.088040; /*NXC3H7O2 */
    /*Now compute conversion */
    amrex::Real XWinv = 1.0/XW;
    y[0] = x[0]*28.013400*XWinv; 
    y[1] = x[1]*15.999400*XWinv; 
    y[2] = x[2]*1.007970*XWinv; 
